import{_ as e,o as a,c as i,O as t}from"./chunks/framework.9482e208.js";const v=JSON.parse('{"title":"§ 6.2-1165 Nonseverability.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/6.2-1165.md","filePath":"vacode/6.2-1165.md"}'),n={name:"vacode/6.2-1165.md"},r=t('<h1 id="§-6-2-1165-nonseverability" tabindex="-1">§ 6.2-1165 Nonseverability. <a class="header-anchor" href="#§-6-2-1165-nonseverability" aria-label="Permalink to &quot;§ 6.2-1165 Nonseverability.&quot;">​</a></h1><p>Notwithstanding the provisions of § <a href="http://law.lis.virginia.gov/vacode/1-243/" target="_blank" rel="noreferrer">1-243</a>, if any portion of this article pertaining to the terms and conditions for and limitations upon acquisition of Virginia savings institution holding companies and Virginia savings institutions by savings institutions and savings institution holding companies that do not have their principal place of business in the Commonwealth is determined to be invalid for any reason by a final nonappealable order of any appropriate Virginia or federal court, then §§ <a href="http://law.lis.virginia.gov/vacode/6.2-1157/" target="_blank" rel="noreferrer">6.2-1157</a> through <a href="http://law.lis.virginia.gov/vacode/6.2-1164/" target="_blank" rel="noreferrer">6.2-1164</a> shall be void and of no further effect from the effective date of such order. Any transaction that has been lawfully consummated pursuant to this article prior to a determination of invalidity shall be unaffected by such determination.</p><p>1985, c. 425, § 6.1-194.106; 1994, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0353" target="_blank" rel="noreferrer">353</a>; 2010, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?101+ful+CHAP0794" target="_blank" rel="noreferrer">794</a>.</p>',3),o=[r];function s(l,c,d,h,f,p){return a(),i("div",null,o)}const g=e(n,[["render",s]]);export{v as __pageData,g as default};
